import React from "react";
import { Table, Container, Button, Modal } from "react-bootstrap";

import VolunteerInfo from "../VolunteerInfo";

const VolunteerTable = () => {
  return (
    <Container>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Language</th>
            <th>Occupation</th>
            <th>Skills</th>
            <th>Role</th>
          </tr>
        </thead>
        <tbody>
          <VolunteerInfo />
        </tbody>
      </Table>
    </Container>
  );
};

export default VolunteerTable;
